    <script type='text/javascript'>

        $(document).ready(function()
        {
            loadJSON('output.json', function(response)
            {
                var data = JSON.parse(response)

                var select = document.getElementById('select')
                select.value = ''
                select.addEventListener('change', function()
                {
                    processResult(data[select.value])
                })

                for (var index in data)
                {
                    var entry = data[index]
                    var option = document.createElement('option')
                    option.value = index
                    option.text = (parseInt(index) + 1) + '. ' + entry.input.pair + ' | ' + entry.operations.length + ' | ' + entry.profitTotal + ' | ' + entry.profitPercentage + '%'
                    select.add(option)
                }
            })
        })

        function loadJSON(file, callback)
        {
            var xobj = new XMLHttpRequest()
            xobj.overrideMimeType('application/json')
            xobj.open('GET', file, true)
            xobj.onreadystatechange = function()
            {
                if ((xobj.readyState == 4) && (xobj.status == '200'))
                {
                    callback(xobj.responseText)
                }
            }
            xobj.send(null)
        }

        function processResult(json)
        {
            var fileName = '../chart/' + json.input.pair + '_' + json.input.interval + '.json'

            loadJSON(fileName, function(response)
            {
                var data = JSON.parse(response)
                var markers = []

                var markerIndex = 1

                for (var index in json.operations)
                {
                    var operation = json.operations[index]

                    for (var i in operation.events)
                    {
                        var event = operation.events[i]

                        if (isValidEvent(event))
                        {
                            markers.push(
                            {
                                x: event.time,
                                title: markerIndex + eventTitle(event),
                                text: eventText(event)
                            })
                        }
                    }

                    markerIndex++
                }

                render(data, markers)
            })
        }

        function isValidEvent(event)
        {
            return (event.type == 'buy') || (event.type == 'sale')
        }

        function eventTitle(event)
        {
            if (event.type == 'watching_buy')
            {
                return 'WB'
            }
            else if (event.type == 'trailing_buy')
            {
                return 'TB'
            }
            else if (event.type == 'buy')
            {
                return 'B'
            }
            else if (event.type == 'watching_sell')
            {
                return 'WS'
            }
            else if (event.type == 'trailing_sell')
            {
                return 'TS'
            }
            else if (event.type == 'sale')
            {
                return 'S'
            }
            else
            {
                return event.type
            }
        }

        function eventText(event)
        {
            if (event.type == 'buy')
            {
                return '<b>' + event.type.replace('_', ' ') + '</b><br>price: ' + event.price + '<br>amount: ' + event.amount + '<br>total: ' + event.total
            }
            else if (event.type == 'sale')
            {
                return '<b>' + event.type.replace('_', ' ') + '</b><br>price: ' + event.price + '<br>amount: ' + event.amount + '<br>total: ' + event.total + '<br>profit total: ' + event.profitTotal + '<br>profit percentage: ' + event.profitPercentage + '%'
            }
            else
            {
                return '<b>' + event.type.replace('_', ' ') + ':</b> ' + event.price
            }
        }
